import Soccer_Svg from "../static/Soccer_Ball_Background";

const Icon = ({ type }) => {
  switch (type) {
    case "soccer":
      return (
        <Soccer_Svg style={{ height: "10px", width: "10px", color: "black" }} />
      );
  }
};
export default Icon;
